import styled from "styled-components";

export const PostsPageWrapper = styled.div`

    .formContainer{
        display: flex;
        justify-content: center;
        margin-bottom: 200px;
    }

    .MuiButtonBase-root{
        margin-top: 10px;
        margin-bottom: 200px;
        padding: 25px;
    }

`;
